   "source": [
    "The data is retrieved from the Chocolate Bar 2020 Kaggle [Chocolate Bar 2020 Kaggle repository](https://www.kaggle.com/soroushghaderi/chocolate-bar-2020).\n",
    "    This dataset has information on 2,224 expert ratings of over 1,700 individual chocolate bars, collected from 2006 to 2020.\n",
    "    It also includes some other information on the chocolate, such as company name, the origin country of beans, and cocoa percent. The rating scale is from 1 (Unpleasant) to 5 (Outstanding). We wish to explore the dataset, and make a simple Shiny app."
   ]
  },
