   "source": [
    "# Loading packages\n",
    "library(ggplot2)\n",
    "library(magrittr)\n",
    "library(dplyr)\n",
    "library(pheatmap)\n",
    "library(tidyr)\n",
    "library(readr)\n",
    "library(textshape)\n",
    "library(knitr)\n",
    "library(xtable)\n",
    "\n",
    "# Reading the data\n",
    "choco = read.csv(\"../input/chocolate-bar-2020/chocolate.csv\", stringsAsFactors = T)\n",
    "choco = choco %>% select(-c(X, ref)) %>% mutate(counts_of_ingredients = as.factor(counts_of_ingredients))\n",
    "str(choco)"
   ]
