   "source": [
    "Due to the large number of producer companies in the dataset, we narrow down our study. So, we select the top 10 companies with the most frequency in the dataset. Using this smaller dataset, we plot three different graphs."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 3,
   "id": "7412dac7",
   "metadata": {
