   },
   "outputs": [],
   "source": [
    "freq_Origin = as.data.frame(table(choco$company))\n",
    "colnames(freq_Origin) = c(\"Company\", \"Frequency\")\n",
    "\n",
    "# The top 10 chocolate bar producers\n",
    "top10s = dplyr::arrange(freq_Origin, desc(Frequency))[1:10,]\n",
    "onlytops = dplyr::filter(choco, company %in% top10s[,1]) \n",
    "\n",
    "# Saving the data with modified data types for GitHub repository, used in Shinyapp\n",
    "write.csv(onlytops,\"Top10Choco.csv\", row.names = FALSE)"
   ]
  },
