   "source": [
    "## 1. Bar plot of the top 10 producers considering number of ingredients used\n",
    "[Figure 1](#Barplot1) shows the total number of chocolate bars of each company, considering the different number of ingredients used in the chocolate bars. We can see that the most frequent producer uses only three ingredients in all of their bars. Generally, most of the companies prefer to use three ingredients, which is evident in the summary statistics of the related variable (”counts of ingredients” column in [table 2](#VarType))."
   ]
  },
