    "## 2. Scatter Plot of changes in the ratings of chocolate bars (2006-2020)\n",
    "[Figure 2](#Scatterplot2) is a scatter plot representing the overall trend in the ratings of companies over the years. Each box in the graph shows the changes in the ratings of the company’s bars. We can see that in some years, there were several ratings reported for different chocolate bars of a company, and the worst rating was for Valrhona company in the year 2007."
