   "source": [
    "Finally, we prepare a shiny app that provides two choices for the user. If the review date is chosen, the app plots [Figure 2](#Scatterplot2). Otherwise, [Figure 3](#Violinplot3) is displayed to the user. The shiny app is accessible via [my shinyapps](https://g-khalili.shinyapps.io/Ghazal-choco_bars/)."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "268b02b6",
   "metadata": {
    "papermill": {
     "duration": 0.083207,
     "end_time": "2022-01-03T19:34:06.617179",
     "exception": false,
     "start_time": "2022-01-03T19:34:06.533972",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "```\n",
    "# Reloading packages\n",
    "library(ggplot2)\n",
    "library(shiny)\n",
    "library(bslib)\n",
    "\n",
    "# Reading our data\n",
    "NewChoco = read.csv(\"https://raw.githubusercontent.com/Ghzlikli/top_ten_chocolate_bars/main/Top10Choco.csv\")\n",
    "\n",
    "ui <- shiny::fluidPage(\n",
    "  # Using a dark theme for UI\n",
    "  theme = bs_theme(bootswatch = \"darkly\"),\n",
    "  titlePanel(\"Top Ten Chocolate Bar Producers Shiny App\"),\n",
    "  selectInput(inputId = \"x_var\", \n",
    "              label = \"Choose a variable for x axis\", \n",
    "              choices = c(\"company\", \"review_date\"),\n",
    "              selected  = \"review_date\", selectize=FALSE),\n",
    "  \n",
    "  shiny::selectInput(inputId = \"y_var\", \n",
    "                     label = \"Choose a variable for y axis\", \n",
    "                     choices = c(\"rating\"),\n",
    "                     selected  = \"rating\"),\n",
    "  \n",
    "  shiny::plotOutput(outputId = \"pair_plot\")\n",
    ")\n",
    "\n",
    "\n",
    "server <- function(input, output){\n",
    "  output$pair_plot <- renderPlot({\n",
    "    \n",
    "    if(input$x_var == \"review_date\"){\n",
    "      ggplot(data  = NewChoco, aes(x = .data[[input$x_var]],\n",
    "                                   y = .data[[input$y_var]], \n",
    "                                   color = company)) + geom_point() +\n",
    "        facet_wrap(~ company, nrow = 2) + geom_line() +\n",
    "        theme(text = element_text(size=20)) + ggtitle(\n",
    "          \"Changes in the ratings of companies' chocolate bars (2006-2020)\") +\n",
    "        scale_x_continuous(breaks=seq(2005,2021,2), guide=guide_axis(angle=90))\n",
    "      \n",
    "    }else{\n",
    "      ggplot(data  = NewChoco, aes(x = .data[[input$x_var]],  \n",
    "                                   y = .data[[input$y_var]])) + geom_violin() +\n",
    "        geom_boxplot(width=0.1, fill=\"white\") +\n",
    "        theme(text = element_text(size=20)) +\n",
    "        ggtitle(\"A compact display of the rating deistribution of companies\")\n",
    "    }\n",
    "    \n",
    "  }, width = 1400, height = 800)\n",
    "}\n",
    "\n",
    "# Building the app\n",
    "shinyApp(ui = ui, server = server)\n",
    "\n",
    "```"
   ]
  }
